import React from 'react';

import { Jumbotron } from 'react-bootstrap';

import './Contact.css';

export default props => {
    return(
        <div className="contact-page">
            <Jumbotron className="contact" style={{ height: "100vh" }}>
                <h1 className="pls" style={{ textTransform: "uppercase" }}>Lichelle Gaerlan</h1>
                <h2 className="pls">Designer / Developer â€¢ Las Vegas</h2>

                <p>
                    If you would like to get in touch or work on a project together,
                    feel free to contact me at
                    lichellemaegaerlan@gmail.com or at (702) 302-2920
                </p>

                <p>
                    Github / LinkedIn / Mail / Phone
                </p>
            </Jumbotron>
        </div>
    );
}
